function get_hightligh_ratio(){
	var hightligh_ratio=document.getElementById("hightligh_ratio").value;

function search_by_key(){
	var hightlight_time = 6;
	var search_result_num = 0;
	var new_color = "red";
	var new_opacity = 1;
	var new_stroke_width = 1;
	var gs = document.getElementsByClassName("myth");
	var key = document.getElementById("search_the_key").value;
	key = key.replace(/\s*$/, "").replace(/^\s*/, "");
	
	if(key.length == 0){alert("keyword is empty");return 1;}

	var hightligh_ratio = get_hightligh_ratio();
	console.log("hightligh_ratio is "+hightligh_ratio);
	if(hightligh_ratio == 0){return 0}

	var re = new RegExp(key,"g");
	for (var i=0; i < gs.length; i++){
		if(gs[i].innerHTML.match(re)){
			//console.log(gs[i].innerHTML);
			search_result_num +=1;
			if (gs[i].hasChildNodes()) {
				var children = gs[i].childNodes;
				for (var ii = 0; ii < children.length; ii++) {
					// do something with each child as children[i]
					// NOTE: List is live, adding or removing children will change the list
					
					if(children[ii].tagName == "title" || children[ii].tagName === undefined){
						continue;
					}
					console.log("tagname is "+children[ii].tagName);
					console.log("style is "+children[ii].style);
					var rawfill = children[ii].style.fill;
					var rawopacity = children[ii].style.opacity;
					var raw_stroke_width =  children[ii].style['stroke-width'];
					console.log("raw_stroke_width is "+raw_stroke_width);
					if(rawopacity>0.8){
						new_opacity=0.5;
					}else{
						new_opacity=1;
					}
					if(raw_stroke_width == 0 ||raw_stroke_width == "0px"){
						new_stroke_width = 1;
					}
					
					new_stroke_width *=hightligh_ratio;

					children[ii].style.fill = new_color;
					var the_time=0;
					var color="";
					var opacity=1;
					var loops=1;
					var stroke_width=0;
					if(loops%2 == 0){alert("loops must be even,like 20, not "+loops)}
					refill(children[ii], new_color,new_opacity, new_stroke_width);
					for(var j=1; j<=loops; j++){ // 100 loops
						the_time += j * 1000 * hightlight_time;
						if(j%2 == 0){
							color=new_color;
							opacity=new_opacity;
							stroke_width=new_stroke_width;
						}else{
							color=rawfill;
							opacity=rawopacity;
							stroke_width=raw_stroke_width;
							}
						setTimeout(refill, the_time,children[ii], color,opacity, stroke_width);
					}
							
				}
			}
		}
	}
	
	if(search_result_num == 0){
		alert("find nothing~");
		return 0;
	}
	//svgpanzoom(0);
	
}

// get transform attribute
function get_transform(attr, target){
	var transform = d3.select(target).attr('transform'); //rotate(30 200 314)  translate(-10 -10) scale(1 0.5) 
	var ret;
	if(transform){
		var myRe = new RegExp(attr);
		
		if(attr == "translate"){
			if(transform.match(myRe)){
				ret = transform.replace(/^.*translate\s*\(\s*/, "").replace(/\s*\).*$/g, "");
				console.log('ret is '+ret);
			}else{
				ret = "0 0";
			}
		}else if(attr == "scale"){
			if(transform.match(myRe)){
				ret = transform.replace(/^.*scale\s*\(\s*/, "").replace(/\s*\).*$/g, "");
			}else{
				ret = "1 1";
			}
		}else if(attr == "rotate"){
			if(transform.match(myRe)){
				ret = transform.replace(/^.*rotate\s*\(\s*/, "").replace(/\s*\).*$/g, "").replace(/\s+.*$/g, "");
			}else{
				ret = "0";
			}
		}else{
			alert("error not support "+attr);
			return 1;
		}
	}else{
		if(attr == "translate"){
			ret = "0 0";
		}else if(attr == "scale"){
			ret = "1 1";
		}else if(attr == "rotate"){
			ret = "0"
		}
	}
	return ret;
}


//onkeyup='translate_it(target, this.value)'
function transform_it(target, value, typee){
	//target.setAttribute('transform', );
	var trans="";
	var transform = d3.select(target).attr('transform');
	console.log('raw transform is '+transform);
	var transform_new="";
	value = value.replace(/^\s+/, "").replace(/\s+$/, "");
	console.log('value is '+value);
	
	if(typee == "rotate"){
		console.log('rotate it');
		var x = d3.select(target).attr("x");
		var y = d3.select(target).attr("y");
		console.log('x ' +x +"; y is "+y);
		if( x || y ){
			value = value + " " + x + " " + y;
		}
	}
	var transform_tmp = typee + "( " + value + " ) ";
	if(transform){
		var myRe = new RegExp(typee);
		var match = myRe.exec(transform);
		if(match){
			myRe= new RegExp(typee+"[^a-z]+", "g");		
			transform_new = transform.replace(myRe, transform_tmp);
			console.log('1');
		}else{
			transform_new = transform + " " + transform_tmp;
			console.log('2');
		}
	}else{
		transform_new = transform_tmp;
		console.log('3');
	}
	
	target.setAttribute('transform', transform_new);
	console.log('new transform is '+transform_new);
}

//onclick='move_feature(\"shift_xy\", \"xy_step\", \"x\", \"+\")'
function caculate_translate(target, shift_xy_id, xy_step_id, xy, change){
	//console.log(d3.select(target).attr("transform"));
	var transform = d3.select(target).attr("transform"); //rotate(30 200 314)  translate(-10 -10) scale(1 0.5) 
	console.log('transform is '+transform);
	if(transform == null){transform=""}
	//var x = d3.select(target).attr("x");
	//var y = d3.select(target).attr("y");
	//var scale_x=1;
	//var scale_y=1;
	//var shift_xy = document.getElementById(shift_xy_id).value;
	var step = document.getElementById(xy_step_id).value;
	step = parseFloat(step);
	console.log('step is ' +step);
	var shift_x=0;
	var shift_y=0;
	
	var myRe = /translate\s*\(\s*([-\.\d]+)\s+([-\.\d]+)\s*\)/g;
	var translate = myRe.exec(transform);
	var translate_str;
	if(translate){
		translate_str = "translate\s*\S+\s+\S+";
		shift_x = translate[1];
		shift_y = translate[2];
		console.log('1 shift_x is '+shift_x);
		console.log('1 shift_y is '+shift_y);
		shift_x = parseFloat(shift_x);
		shift_y = parseFloat(shift_y);
	}
	
	if(change == "+"){
		change = 1;
		console.log('change is +');
	}else if(change == "-"){
		change = -1;
		console.log('change is -');
	}else{
		alert('error, need + or - , not '+change);
		return 1;
	}
	console.log('change is '+change);
	if(xy == "x" ){
		console.log(shift_x+"+="+step+"*"+change);
		shift_x = shift_x + step * change;
		console.log(shift_x);
	}else if(xy == "y"){
		console.log(shift_y+"+="+step+"*"+change);
		shift_y = shift_y + step * change;
		console.log(shift_y);
	}else{
		alert('error in move_feature '+ xy);
		return 1;
	}
	document.getElementById(shift_xy_id).value = shift_x + " " + shift_y;
	console.log('shift_xy value is now '+ document.getElementById(shift_xy_id).value);
	
	//transform_it(target, value, type)
	transform_it(target, shift_x + " " + shift_y, 'translate');
		
}
